import React, { useEffect, useState } from 'react';
import Tree, { RawNodeDatum, CustomNodeElementProps } from 'react-d3-tree';
import { User } from '../types/User';
import { useUsers } from './UserContext';
import {
  Box,
  Card,
  Avatar,
  Typography,
  useTheme,
  alpha
} from '@mui/material';

type NodeAttributes = {
  [key: string]: string | number | boolean;
  name: string;
  role: string;
}

interface OrgChartNodeData extends RawNodeDatum {
  name: string;
  attributes?: NodeAttributes;
}

const stringToColor = (string: string) => {
  let hash = 0;
  for (let i = 0; i < string.length; i++) {
    hash = string.charCodeAt(i) + ((hash << 5) - hash);
  }
  let color = '#';
  for (let i = 0; i < 3; i++) {
    const value = (hash >> (i * 8)) & 0xFF;
    color += ('00' + value.toString(16)).substr(-2);
  }
  return color;
};

const OrgChart: React.FC = () => {
  const theme = useTheme();
  const { users } = useUsers();
  const [treeData, setTreeData] = useState<OrgChartNodeData | null>(null);

  useEffect(() => {
    const buildTreeData = (users: User[]): OrgChartNodeData | null => {
      if (!users.length) return null;

      // If no users have managerId set, create temporary relationships
      const hasManagerRelationships = users.some(user => user.managerId !== undefined);
      let processedUsers = [...users];

      if (!hasManagerRelationships) {
        // Find users by team
        const teamLeads = new Map<string, number>();
        const ceo = processedUsers.find(u => u.jobRole.toLowerCase().includes('ceo') || 
                                           u.jobRole.toLowerCase().includes('chief'));

        // If no CEO found, use the first user as root
        const root = ceo || processedUsers[0];
        root.managerId = undefined; // Root has no manager

        // Assign team leads reporting to CEO
        processedUsers.forEach(user => {
          if (user.id === root.id) return;

          if (user.jobRole.toLowerCase().includes('manager') || 
              user.jobRole.toLowerCase().includes('lead') || 
              user.jobRole.toLowerCase().includes('head')) {
            teamLeads.set(user.team, user.id);
            user.managerId = root.id;
          }
        });

        // Assign remaining team members to their team leads
        processedUsers.forEach(user => {
          if (user.id === root.id || teamLeads.has(user.team)) return;

          const teamLead = teamLeads.get(user.team);
          if (teamLead) {
            user.managerId = teamLead;
          } else {
            user.managerId = root.id; // Report to CEO if no team lead
          }
        });
      }

      // Find the root (CEO or user without managerId)
      const root = processedUsers.find(user => !user.managerId);
      if (!root) return null;

      const buildNode = (user: User): OrgChartNodeData => {
        const children = processedUsers
          .filter(u => u.managerId === user.id)
          .map(child => buildNode(child));

        return {
          name: user.name,
          attributes: {
            name: user.name,
            role: user.jobRole,
            id: user.id || '',
            team: user.team || '',
            location: user.location || ''
          },
          children: children.length ? children : []
        };
      };

      return buildNode(root);
    };

    const data = buildTreeData(users);
    setTreeData(data);
  }, [users]);

  const renderCustomNode = ({ nodeDatum }: CustomNodeElementProps) => {
    const attrs = nodeDatum.attributes as NodeAttributes;
    const initials = attrs.name.split(' ').map(n => n[0]).join('');
    const bgColor = stringToColor(attrs.name);

    return (
      <Card
        sx={{
          p: 1,
          minWidth: 200,
          bgcolor: alpha(theme.palette.background.paper, 0.9),
          boxShadow: 3,
          borderRadius: 2
        }}
      >
        <Box sx={{ display: 'flex', alignItems: 'center', gap: 1 }}>
          <Avatar
            sx={{
              width: 40,
              height: 40,
              bgcolor: bgColor,
              fontSize: '1rem',
              fontWeight: 500
            }}
          >
            {initials}
          </Avatar>
          <Box>
            <Typography variant="subtitle2" noWrap>
              {attrs?.name || ''}
            </Typography>
            <Typography variant="caption" color="textSecondary" noWrap>
              {attrs?.role || ''}
            </Typography>
          </Box>
        </Box>
      </Card>
    );
  };

  if (!treeData) {
    return (
      <Box sx={{ p: 3 }}>
        <Typography>Loading organization chart...</Typography>
      </Box>
    );
  }

  return (
    <Box sx={{ width: '100%', height: '100vh' }}>
      <Tree
        data={treeData}
        renderCustomNodeElement={renderCustomNode}
        orientation="vertical"
        pathFunc="step"
        translate={{ x: window.innerWidth / 2, y: 50 }}
        separation={{ siblings: 2, nonSiblings: 2.5 }}
        zoom={0.7}
        nodeSize={{ x: 250, y: 100 }}
      />
    </Box>
  );
};

export default OrgChart;
